(function($) {

	$.currentsetting = {
		// URIを解析したオブジェクトを返すfunction
		Uri: function(path){
			var self = this;
			this.originalPath = path;
			//絶対パスを取得
			this.absolutePath = (function(){
				var e = document.createElement('a');
				e.href = path;
				return e.href;
			})();
			//絶対パスを分解
			var fields = {'schema' : 2, 'username' : 5, 'password' : 6, 'host' : 7, 'path' : 9, 'query' : 10, 'fragment' : 11};
			var r = /^((\w+):)?(\/\/)?((\w+):?(\w+)?@)?([^\/\?:]+):?(\d+)?(\/?[^\?#]+)?\??([^#]+)?#?(\w*)/.exec(this.absolutePath);
			for (var field in fields) {
				this[field] = r[fields[field]];
			}
			this.querys = {};
			if(this.query){
				$.each(self.query.split('&'), function(){
					var a = this.split('=');
					if (a.length == 2) self.querys[a[0]] = a[1];
				});
			}
		},
		//ユニークな配列を取得
		uniqueArray: function(array) {
			var storage = new Object;
			var uniqueArray = new Array();
			var i, value;
			for (var i=0;i<array.length;i++) {
				value = array[i];
				if (!(value in storage)) {
					storage[value] = true;
					uniqueArray.push(value);
				}
			}
			return uniqueArray;
		},
		//現在のページと親ディレクトリへのリンク
		selflink: function (options) {
			var c = $.extend({
				selfLinkAreaSelector:'body',
				selfLinkClass:'is-current',
				parentsLinkClass:'is-parents'
			}, options);
			$(c.selfLinkAreaSelector+((c.selfLinkAreaSelector)?' ':'')+'a[href]').each(function(){
				var href = new $.currentsetting.Uri(this.getAttribute('href'));
				if ((href.absolutePath == location.href) && !href.fragment) {
					//同じ文書にリンク
					$(this).addClass(c.selfLinkClass);
				} else if (0 <= location.href.search(href.absolutePath)) {
					//親ディレクトリリンク
					$(this).addClass(c.parentsLinkClass);
				}
			});
		},
		//カテゴリー内表示
		category: function(options) {
			var c = $.extend({
				buttonSelector: '.js-same-category',
				selectClass: 'is-same-category'
			}, options);
			var bodyClasses = new Array();
			if ($('body').attr('class')) {
				bodyClasses = $('body').attr('class').split(' ');
			}
			for (var i=0;i<bodyClasses.length;i++) {
				$(c.buttonSelector).each(function(){
					if ($(this).hasClass(bodyClasses[i])) {
						//初期表示
						$(this).addClass(c.selectClass);
					}
				});
			}
		}
	};
})(jQuery);

/*
 * acs.js 0.0.1 - 出現したらaddclassするプラグイン
 *
 * Since:     2019-02-01
 * Modified:  2012-02-04
 */

(function($) {
  $.fn.acs = function(options) {
      var elements = this;
      var defaults = {
          screenPos: 0.8,
          className: 'is-show'
      };
      var setting = $.extend(defaults, options);
      $(window).on('load scroll', function() {
          add_class_in_scrolling();
      });
      function add_class_in_scrolling() {
          var winScroll = $(window).scrollTop();
          var winHeight = $(window).height();
          var scrollPos = winScroll + (winHeight * setting.screenPos);

          if(elements.offset().top < scrollPos) {
              elements.addClass(setting.className);
          }
      }
  }
})(jQuery);